export default {
  name: "Login",
  mounted: function mounted() {
    var name = this.$route.query.name;
    var email = this.$route.query.email;
    var idToken = this.$route.query.id_token;
    var payload = {
      name: name,
      email: email,
      idToken: idToken
    };

    if (name && email && idToken && name != "" && email != "" && idToken != "") {
      this.$store.commit("login", payload);
    } else {
      this.$store.commit("logout");
    }

    this.$router.push("/");
  }
};
